import React from 'react'
import { Seashore } from '../images/index'

const About = () => {
  return (
    <div>
        <figure className="border-black border-solid border-2 h-80">
          <img src={Seashore} alt="100 Islands Seashore" className="h-80 w-screen object-cover" />
        </figure>
    </div>
  )
}

export default About
